Defendant Larry L Haynes in court, in custody, with attorney M. Elizabeth Weathers.    District Attorney's Office Law Intern appeared for the State of Wisconsin.

Plea Colloquy.

Defendant enters a guilty plea to Count 1.  Court finds defendant guilty.

The Court Orders the Following:

Imposed and Stayed Sentence of:

9 months Jail  First 60 days Straight time Remaining  Huber with Standard Release conditions (Credit - 8 days)  CONSECUTIVE TO MILWAUKEE CASE 14CF5019

Term of Probation:  1 Year  CONSECUTIVE TO MILWAUKEE CASE 14CF5019

Conditions of Probation:
- Absolute Sobriety; Random U.A.s;
- No Use or Possession of alcohol or illegal drugs or drug paraphernalia;
- No Use or Possession of prescription drugs without a valid prescription;
- Any valid prescription drugs must be taken in the manner in which they are prescribed;
- Inform agent of all prescriptions;
- Sign Medical Release for Agent;
- Maintain/Obtain full time activity;
- No contact with Woodmans on East Main in Waukesha.

Restitution: $278.30 to Woodman's (to be paid duringterm of probation )

Costs: $253.00 
DNA Surcharge:  $200.00
(To be paid as a condition of probation at the rate of $50.00  per month and/or 46 hours of community service to be completed by the end of probation.  Court must receive notice of completion prior to due date.  Failure to pay or complete community service the Court orders 9 days Huber as contempt for non-compliance with Court Order).
BAIL TO BE REFUNDED TO POSTER.

Condition Time: 15 days  Jail - Stayed and to be used at the agent's discretion.
